import './Css/competencias.css'


function ComponenteBairro (props) {
    return (
        <>
        <p className='p1'>{props.nome}</p>
        <p className='p2'>{props.rua}</p>
        <p className='p3'>{props.bairro}</p>
        <p>{props.logradouro}</p>
        <p>{props.cidade}</p>
        <p>{props.numero}</p>
        </>
    )
}

export {ComponenteBairro}
